At the highest level of abstraction, a dual socket and a single socket machine are the same. They allow an application to access all the resources shared between the CPU's. But as we dig a little deeperThere are some key things to understand about dual socket MB's that most people take for granted that can impact an application's performance in subtle but significant ways. Dual socket motherboard The first thing I notice about this pictures is that both the CPU sockets have their own hunks of ram next to each other. And thats for a reason: Each CPU chip has its own dedicated RAM and PCIe 3.0 ports. Typicaly the ram around a socket is alligned to that socket. For the PCIe 3.0 port mappings, the motherboards manual should have all the details. So, why does that matter? Lets look a level deeper. graph RL;
