Modern processors are designed to work with virtual memory efficiently, and they contain a TLB inside of the memory management unit. It is a cache which stores recent translations of virtual memory address to physical memory addresses. [2] Virtual addresses have a predefined set of bits which represent a page number(A page is a block of virtual memory), and the rest represent an offset into that page. Modern processors have multiple TLB cahces, typically 1 per core split into multiple segments based on page size. Nehalem processors for example have 4 L1 TLB's. [3] 2 Data TLB's with 64 entries for 4 kb pages and 32 entries for 2/4 mb pages and 2 instruction TLB's with 128 entries for 4kb pages and 14 fo 2/4 mb pages. Finally they have an L2 unified 512 entry TLB for 4kb pages. Various different intel and AMD architectures have adjusted these various sizes between generations as they attempt ot find the right tradeoff between TLB misses for generic workloads and transistor counts. Modern processors also do hardware page walks to find the right page of memory if there was a TLB miss. Ultimately, since the page table is in RAM, it may also be cached, so the CPU checks caches first before accessing ram. graph TD;
start[Need to load data from ram] --&gt; checkTbl[CPU checks TLB];
checkTbl --&gt; tblHas{Does page exist in ram};
tblHas --&gt;|Yes| physical[CPU Generates physical Address];
tblHas --&gt;|No| accessTable[Access Page Table&lt;br&gt;in cache or RAM];
accessTable --&gt; inRam{Page is in main memory};
inRam--&gt;|Yes| updateTlb[Update TLB];
updateTlb--&gt;physical;
%% Source: https://en.wikipedia.org/wiki/Translation_lookaside_buffer The above assumes that the OS has not page swapped anything in ram to disk, if that were to happen, the OS gets a page fault and must load the memory segment from the disk. So, why do we care about this? Lets first remember to context of our TLB it is required every time we try to access anything in memory, even if that item is already in cache! The cache keeps things based on physical addresses. So, this can cause our normal code to have to take a break and go to main memory (in the worst case) in order to access or modify a value we already have in cache. Now lets imagine we have a full cache miss and a full TLB miss? Now we have to do 2 full RAM reads, one to access the page table to figure out which ram we need to read, and a second to actually get the data. But we have some good news: CPU designers know about this limitation and have invested heavily in mitigating it. Using speculation, the CPU can try to keep the TLP populated with the relevant entires which can reduce the risk of having a TLB miss. It's also smart enough to use the other caches like L3 cache to store parts of the page table on the CPU to reduce the cost of a miss.

