At the same time, having a misconfigured application, or an application that is very inefficient with its ram usage can suffer from TLB thrashing. Thrashing is defined as overuse of virtual memory resources causing very high rates of TLB misses. This happens when the set of active pages in use by a CPU excedes the ability of the TLB to store all those pages. Here, active pages specifically means pages which are used very frequently. An example of a data structure which might cause serious TLB Thrashing, on a system configured for G1 garbage collection: public class Example{ Object[] a = new Object[32];
}
LinkedList<Example> aLongLinkedList = getListOfExamples();
for(Example e: aLongLinkedList){ for(Object o: e.a){ o.hashCode(); }
} So why is this so bad? Well, in java, there is no such thing as locality for java objects. This means that each node in our linked list may be in 1 page, which points to our example object on another page, which has an array pointer which may point to another page. That array can then point to 32 objects each on another page. So to visit just 1 Example object above, we could hit as many as 35 different pages, and as few as just 1. It depends on both how the OS allocated the JVM's ram, and how the JVM has compacted these objects. Its critical that the TLB miss can rely on L1, L2 and L3 cache to satisfy missing when thrashing is happening to minimize its cost per instance. Wikipedia: CPU Cache Wikipedia: Translation Lookaside buffer Inside Nehalem: TLBs, Page Talbes and Synchronization
